INSERT INTO `questionnaire` VALUES (14,'Service Quality Questionnaire','Dear Participant, |Thank you for taking the time to participate in this survey. We follow the Declaration of ethical principles of Helsinkis in research. Therefore, the information you provide will be kept strictly confidential and will be used only for research purposes. There are no right or wrong answers, and we encourage you to be as honest and thoughtful as possible. The questionnaire should last only 5 minutes.',NULL,NULL,'2024-01-31 16:27:42.770960',1,'service quality'),(15,'Self-diagnostic on Sustainability Questionnaire','Sustainability is a success factor for all businesses. It is very important to understand how is your company positioned in view of others. Thus, you may better plan your actions and evaluate your results. |We help you in that regard. You access a questionnaire and you are able to obtain responses after that. The questionnaire is intended for Small and Medium Entreprises (SMEs) operating in the tourism sector. Information will be confidential. |The results compare the performance of your company with the average of companies inspected so far. Thus you may understand your position in comparison with other SMEs and articulate your action plans. In most variables, your performance is compared with the top 25% best performing companies in the specific criteria. For the remaining ones, averages are used. |There are three groups of criteria considered, namely: economic, social and environment. These three account for how your company performs in sustainability. |According to some criteria, the list of variables that are collected include: |1) ECONOMY - It captures information related to the quantity and quality of employment and suppliers. |2) SOCIAL - It captures information related to your activities regarding community and social impact; health and safety; inclusion and accessibility; protecting cultural heritage. |3) ENVIRONMENT - It captures information associated to the optimal use of resources, namely: reducing transportation impact, solid waste management, water management, energy usage and landscape and biodiversity protection. |4) DEMOGRAPHICS - It captures information about your company.',NULL,NULL,'2024-02-01 00:04:18.120875',1,'sustainability');
